import React, { Component } from 'react';

class Input extends Component {
  render () {
    const { type, value, handleChange, name, placeholder } = this.props;
    return (
      <input
        type={ type }
        value={ value }
        onChange={ handleChange }
        name={ name }
        placeholder={ placeholder }
      />
    )
  }
}

export default Input;
